import "../css/my_page.css";

const My_Page = () => {
    return (
        <React.Fragment>
            <div className="mypage_wrap">
                <div className="info_wrap">
                    <div className="profile">

                    </div>
                </div>
            </div>
        </React.Fragment>
    )
}

export default My_Page;
